Seria bagaży Preston World Champion została wykonana z mieszanki wysokiej jakości gładkiej tkaniny typu <span lang="pl-pl" xml:lang="pl-pl">840D z materiałem EVA zapewniając tym samym możliwie wysoką wytrzymałość i trwałość. Każdy produkt wchodzący w serię World Champion został zaprojektowany i skonsultowany z kadrą Preston Innovations England National Feeder Team w celu stworzenia jak najbardziej optymalnego bagażu dla doświadczonych i najbardziej wymagających wędkarzy. Warto zwrócić uwagę na fakt, iż wszystkie produkty z tej serii charakteryzują się stosunkowo dużą pojemnością mającą na celu sprostanie takiemu wyzwaniu jak odpowiednia organizacja wyczynowego wędkarza.</span>



Wymiary: 24 x 40 x 20cm (wysokość x długość x szerokość)



&nbsp;



&nbsp;

Tacka z parawanem zakrywającym powierzchnię tacki. Możliwy jest demontaż parawanu. W skład zestawu wchodzi tacka oraz sześć nakladek: 2x30mm Okrągła, 2x25mm Okrągła, 2x23mm OnBox. Bez używania wkładek kompatybilne z nogami o średnicy 36mm



Wymiary: 54 x 44 cm



