Aperio to nowatorski podajnik do metody, w całości zaprojektowany i stworzony przez zespół testerów Mikado. Wielomiesięczne testy na różnych łowiskach utwierdziły producentów w przekonaniu, że łowienie przy pomocy podajnika otwartego daje wędkarzowi większą ilość brań, niż przy zastosowaniu wersji z żebrami.



Występuje w gramaturach: 15 / 20 / 30 / 40 / 50 / 60 gram.



&nbsp;

Haczyk MILO R305 BLK to kultowy, najpopularniejszy w Polsce, wyczynowy haczyk typu “crystal” o okrągłym łuku kolankowym. Haczyki Milo R305 BLK posiadają czarną barwę i stosunkowo cienki drut umożliwiający zastosowanie ich przede wszystkim do łowienia na ochotkę. Są bardzo lekkie, a przy tym bardzo ostre co predysponuje je do użycia w łowiskach powszechnie uznawanych za trudne, gdzie każdy detal ma ogromne znaczenie na końcowy rezultat.

Rozmiar 20 i 18 powinno stosować się do łowienia na pojedyncze larwy ochotki i pinki;
Rozmiar 16 i 14 jest na tyle duży, że można zakładać duże pęczki ochotek, białe robaki czy kawałki czerwonych robaków.

